import classes from './TodoItem.module.css';

const TodoItem: React.FC<{ text: string; removeHandler: (id: string) => void }> = (props) => {
  return <li onClick={props.removeHandler(props.key)} className={classes.item} id={props.key}>{props.text}</li>;
};

export default TodoItem;
